import React from 'react';
import '../styles/components/LogoutConfirmationStyle.css';

function LogoutConfirmation({onCancel, onConfirm}) {
    return (
        <div className="logout-confirmation-container">
            <div className="logout-confirmation-box">
                <h2>Confirm Logout</h2>
                <p>Are you sure you want to log out?</p>
                <div className="confirmation-buttons">
                    <button onClick={onCancel}>Cancel</button>
                    <button onClick={onConfirm}>Logout</button>
                </div>
            </div>
        </div>
    );
}

export default LogoutConfirmation;
